import React from 'react';
import '../../styles/resume.css';
import MyResume from '../../path/to/your/resume.pdf';

const styles = {
  resumeStyle: {
    background: 'red',
  },
  ResumeStyle: {
    fontSize: '100px',
  },
};

function resume() {
  const handleDownloadResume = () => {
    const anchor = document.createElement('a');
    anchor.href = MyResume; // Use the imported resume file
    anchor.download = 'MyResume.pdf'; // Provide a name for the downloaded file
    anchor.click();
  };
  return (
    <header style={styles.resumeStyle} id="myResume" className="resume">
      <h1 style={styles.ResumeStyle}>Resume</h1>
    </header>
  );
}

export default resume;
